import React from 'react';
import Tween from 'rc-tween-one';
import content from './SectionsContent';
import callDialog from './Dialog';

const find = id => content.find(p => p.id === id);

function Twn({n}) {
    const styles = {
        opacity: 0,
        transform: 'translateY(0)',
        backgroundColor: '#fff',
        top: '0vh'
    }
    const animation = {
        from: {
            delay: 1000,
            duration: 600,
            opacity: 0,
            x: 0,
            top: 0,
            ease: "linear",
            backgroundColor: n.cor2
        },
        to: {
            delay: 1000,
            duration: 300,
            opacity: 1,
            x: 0,
            y: '0',
            top: 0,
            ease: "easeOutCirc",
            backgroundColor: '#fff'
        }

    };
    return (
        <div>
            <Tween
                key='tweenOne2'
                reverseDelay={4000}
                component={'section'}
                animation={[
                {
                    ...animation.from
                }, {
                    ...animation.to
                }
            ]}
                style={styles}
                className={"tween-one cabecalho"}>
                <CallDialog
                    data={{params: {n: n.id}}}
                   />
                <h1 style={{
                    color: n.cor2
                }}>{n.letra}</h1>
                <label>{n.label}</label>
                <h2>{n.h2}</h2>
                <div className='descricao'>{n.descricao}</div>
            </Tween>

        </div>
    )
}

  export default Twn ;
